import React, {Component} from 'react';

class Spotlight extends Component {
  constructor(props) {
    super(props);
  }

  render(){
    return (
      <div>
        <h1>{this.props.location.props.src}</h1>
      </div>
    )
  }
}

export default Spotlight;
